data = str('')
data_enc = data.encode()

x = 'pic'
y ='.jpg'
with open(str(x), "wb") as fts:
	did = base64.decodebytes(data_enc)
	fts.write(did)
os.rename(str(x),str(x)+str(y))
Box = tk.Tk()
Box.overrideredirect(True)
Box.resizable(False, False)
Box.state("zoomed")
c = Canvas(Box)
c.pack(fill=tk.BOTH, expand=True)      
img = PhotoImage(file=str(x)+str(y))      
c.create_image(700,450,image=img)      
os.remove(str(x)+str(y))
Box.mainloop()